<template>
  <view class="cu-bar tabbar bg-white shadow foot">
    <view
      class="action"
      @click="cut('home')"
    >
      <view class='cuIcon-cu-image'>
        <image src="data:image/png;base64,">
      </view>
      <view :class="PageCur=='plugin'?'text-green':'text-gray'">首页</view>
    </view>
    <view
      class="action"
      @click="cut('shopping-cart')"
    >
      <view class='cuIcon-cu-image'>
        <view class="cu-tag badge">{{count}}</view>
        <image src="data:image/png;base64," />
      </view>
      <view :class="PageCur=='plugin'?'text-green':'text-gray'">购物车</view>
    </view>
    <view
      class="action"
      @click="cut(userType+''==='1'?'order':'track')"
    >
      <view class='cuIcon-cu-image'>
        <image src="data:image/png;base64," />
      </view>
      <view :class="PageCur=='plugin'?'text-green':'text-gray'">{{userType+''==='1'?'订单':'跟踪'}}</view>
    </view>
    <view
      class="action"
      @click="cut('mine')"
    >
      <view class='cuIcon-cu-image'>
        <image src="data:image/png;base64," />
      </view>
      <view :class="PageCur=='plugin'?'text-green':'text-gray'">我的</view>
    </view>
  </view>
</template>

<script>
export default {
  props: {
    value: String,
		shoppingCartCount: {
		  type: Number,
		  default: 0,
		},
  },
  data() {
    return {
      current: this.value,
      data: [],
			count: this.shoppingCartCount
    };
  },
	computed:{
		userType(){
			return this.$store.getLoginInfo()?.data?.userType
		}
	},
  watch: {
		shoppingCartCount(val){
			this.count=this.count+1;
		},
    value(value) {
      this.current = value;
    },
    current() {
      this.$emit('input', this.current);
      this.$emit('change', this.current);
    },
  },
  methods: {
    cut(value) {
      this.current = value;
    },
  },
};
</script>

